import React from 'react';

const Home = () => {
    return ( 
        <div className="home">
                    <Navbar>
       <Navbar.Brand className="name-web">HudzevResto</Navbar.Brand>
       <Nav className="mr-auto">
          <Link className="link1" to="/">Home</Link>
          <Link className="link1" to="/makanan">Makanan</Link>
          <Link className="link1" to="/minuman">Minuman</Link>
          <Link className="link1" to="/contact">Contact</Link>
          </Nav>
          </Navbar>

        </div>
     );
}

export default Home;
